import React from "react";
import "./Navbar.css";
function Navbar(){
    return (
        <div className="Navigation">
        <div class="navbar">
                <li><span id="l1">MONEY </span><span id="l2">MATTERS</span></li>
                <li><Link to="/src/Components/Home.jsx" class="link">HOME</Link></li>
                <li><Link to="/src/Components/Login.jsx" class="link">LOGIN</Link></li>
                <li><Link to="/src/Components/Register.jsx" class="link">REGISTER</Link></li>
                <li><Link to="/" class="link">ABOUT</Link></li>
        </div>
    </div>
    );
}


export default Navbar;
